000','2023-12-23 01:00:59.312000','This time, they\'re breaking in!','2023-12-30 01:01:16.216000','2023-12-31 01:01:19.691000'),(83,'admin1@gmail.com',NULL,NULL,'2023-12-22 08:05:31.836951','ENABLE','Silent Night','COMING_SOON','2024','120','Mỹ',10.00,'A tormented father witnesses his young son die when caught in a gang\'s crossfire on Christmas Eve. While recovering from a wound that costs him his voice, he makes vengeance his life\'s mission and embarks on a punishing training regimen in order to avenge his son\'s death.','2024-01-06 01:05:09.002000','2024-01-06 01:05:06.748000','Action speaks louder than words.','2024-01-06 01:05:11.896000','2024-01-06 01:05:13.978000'),(84,'admin1@gmail.com',NULL,NULL,'2023-12-22 08:09:03.615059','ENABLE','Good Boy','COMING_SOON','2023','123','Mỹ',7.00,'Christian - a millionaire heir, meets Sigrid - a young student, on a dating app. They hit it off quickly, but there\'s only one problem: Christian lives with Frank, a man who dresses up and constantly acts like a dog.','2024-01-04 01:08:33.300000','2024-01-04 01:08:30.598000','Simply put, he\'s a dog.','2024-01-05 01:08:47.271000','2024-01-06 01:08:49.166000'),(85,'admin1@gmail.com',NULL,NULL,'2023-12-22 08:11:59.752401','ENABLE','Spider-Man: No Way Home','EXPIRED','2023','118','Mỹ',10.00,'Peter Parker is unmasked and no longer able to separate his normal life from the high-stakes of being a super-hero. When he asks for help from Doctor Strange the stakes become even more dangerous, forcing him to discover what it truly means to be Spider-Man.','2023-12-06 01:11:25.300000','2023-12-06 01:11:21.341000','The Multiverse unleashed.','2023-12-06 01:11:50.150000','2023-12-06 01:11:52.841000'),(86,'admin1@gmail.com',NULL,NULL,'2023-12-22 08:35:27.989064','ENABLE','The Family Plan','EXPIRED','2023','7','Mỹ',10.00,'Dan Morgan is many things: a devoted husband, a loving father, a celebrated car salesman. He\'s also a former assassin. And when his past catches up to his present, he\'s forced to take his unsuspecting family on a road trip unlike any other.','2023-12-05 01:34:18.249000','2023-12-04 01:34:14.632000','Dan Morgan is many things','2023-12-05 01:34:34.608000','2023-12-06 01:34:37.514000'),(87,'admin1@gmail.com',NULL,NULL,'2023-12-22 08:38:35.887872','ENABLE','The Immortal Wars: Rebirth','EXPIRED','2021','123','Mỹ',3.00,'Rebirth takes place during the early brutal stages of Dominion Industries. In this story watch Olive and other deviants undergo a series of deadly experiments lead by Laurie Harvey and her team.','2023-11-27 01:37:55.244000','2023-11-27 01:37:53.182000','Every battle has two sides','2023-11-29 01:38:09.415000','2023-11-30 01:38:11.179000');
